import React, { Component } from 'react';
import header_bg from '../../assets/images/header_bg.jpg';

import './Header.css';

export class Header extends Component {
  render() {
    return (
      <div className="bg-container">
        <img src={header_bg}/>
      </div>
    )
  }
}

export default Header;
